import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Checkout = () => {
  const navigate = useNavigate();
  const [cartItems, setCartItems] = useState([]);
  const [userInfo, setUserInfo] = useState({ name: "", address: "", phone: "" });

  // Get userId from localStorage
  const userId = localStorage.getItem("userId");

  useEffect(() => {
    console.log("User ID from localStorage:", userId); // Debugging log

    if (!userId) {
      console.error("User ID is not available.");
      return;  // Don't proceed further if userId is not available
    }

    const fetchCart = async () => {
      try {
        console.log("Fetching cart for user:", userId); // Debugging log
        const response = await axios.get(`https://food-delivery-gj0r.onrender.com/api/cart/${userId}`);
        setCartItems(response.data.items || []);
      } catch (error) {
        console.error("Failed to fetch cart:", error);
      }
    };

    fetchCart();
  }, [userId]);

  const totalAmount = cartItems.reduce(
    (sum, item) => sum + (item.price || 0) * item.quantity,
    0
  );

  const handleContinue = async (e) => {
    e.preventDefault();

    try {
      const orderData = {
        userId,
        userInfo, 
        items: cartItems.map(item => ({
          foodItem: item.productId?.name,
          quantity: item.quantity,
          costForTwo: item.price,
        })),
        totalAmount,
      };

      console.log("Order Data to be sent:", orderData); // Debugging log

      await axios.post("https://food-delivery-gj0r.onrender.com/api/orders/create", orderData);

      navigate("/payment");
    } catch (error) {
      console.error("Failed to place order:", error);
    }
  };

  return (
    <div style={styles.wrapper}>
      <div style={styles.container}>
        <h2 style={styles.heading}>Checkout</h2>
        <form onSubmit={handleContinue} style={styles.form}>
          <label style={styles.label}>Name:</label>
          <input
            type="text"
            placeholder="Enter Your Name"
            required
            value={userInfo.name}
            onChange={(e) => setUserInfo({ ...userInfo, name: e.target.value })}
            style={styles.input}
          />

          <label style={styles.label}>Address:</label>
          <textarea
            placeholder="123, Food Street"
            required
            value={userInfo.address}
            onChange={(e) => setUserInfo({ ...userInfo, address: e.target.value })}
            style={styles.textarea}
          ></textarea>

          <label style={styles.label}>Phone:</label>
          <input
            type="tel"
            placeholder="Enter Mobile Number"
            required
            value={userInfo.phone}
            onChange={(e) => setUserInfo({ ...userInfo, phone: e.target.value })}
            style={styles.input}
          />

          <h3 style={styles.total}>Total: â‚¹{totalAmount}</h3>

          <button type="submit" style={styles.button}>
            Continue to Payment
          </button>
        </form>
      </div>
    </div>
  );
};

const styles = {
  wrapper: {
    padding: "20px",
  },
  container: {
    maxWidth: "600px",
    margin: "0 auto",
    borderRadius: "8px",
    backgroundColor: "#f9f9f9",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    padding: "20px",
  },
  heading: {
    textAlign: "center",
  },
  form: {
    display: "flex",
    flexDirection: "column",
  },
  label: {
    margin: "10px 0 5px",
  },
  input: {
    padding: "10px",
    marginBottom: "20px",
    borderRadius: "4px",
    border: "1px solid #ccc",
  },
  textarea: {
    padding: "10px",
    marginBottom: "20px",
    borderRadius: "4px",
    border: "1px solid #ccc",
    height: "100px",
  },
  total: {
    fontSize: "18px",
    fontWeight: "bold",
    marginTop: "10px",
  },
  button: {
    padding: "10px 20px",
    backgroundColor: "#007bff",
    color: "white",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
};

export default Checkout;
